base : "https://api.openweathermap.org/data/2.5"
}
 

function App() {
  
  return (
    <div className="WeatherApp">
      <header className="App-header">
        <main>
          <div className="search-bar">
            <input 
            type = "text" autoComplete= "on" placeholder= "Enter a city..." 
            />
